import { Component } from "react";
import styles from './styles.css'
import BubbleAlert from './BubleAlert'

class Carro extends Component {
    render() {
        return(
            <div>
                <span style={styles}>
                    <BubbleAlert />
                </span>
                <button style={styles} className="carro"> 
                    Carro
                </button>
            </div>
        )
    }
}

export default Carro
